import styled from "styled-components/native";

export const LastView = styled.View`
    position: absolute;
    width: 100%;
    height: 127px;
    background-color: #4E4E4E;
    align-items: center;
    justify-content: space-around;
    top: 623;
    flex-direction: row;
`

export const PriceColumn = styled.View`

`;

export const Total = styled.Text`
    font-family: 'Roboto';
    font-style: normal;
    font-weight: 300;
    font-size: 18px;
    letter-spacing: -0.333333px;
    color: #FFFFFF;
`; 

export const Pricing = styled.Text`
    font-family: 'Roboto';
    font-style: normal;
    font-weight: 900;
    font-size: 36px;
    letter-spacing: -0.333333px;
    color: #FFFFFF;
`;

export const Paytxt = styled.Text`
    font-family: 'Roboto';
    font-style: normal;
    font-weight: 300;
    font-size: 18px;
    letter-spacing: -0.333333px;
    color: #000000;

`;

export const Second = styled.View`
    flex-direction: row;
    margin-top: 33px;
    align-items: center;
    justify-content: space-between;
`;

export const SelectTxt = styled.Text`
    font-family: 'Roboto';
    font-style: normal;
    font-weight: 900;
    font-size: 14px;
    text-align: center;
    color: #FFFFFF;
    padding-left: 64px;
`;

export const Radiobtn = styled.View`
    width: 16px;
    height: 16px;
    background: #6C63FF;
    border: 3px solid #4E4E4E;
    border-radius: 100px;
    padding-right: 71px;
    
`
